ui=336,yu=337,punto=338,coma=339,eu=340,eui=341,i=342
}}
maxSpeed=16
t=0
position={
	x=96,
	y=24
}
speed=0
count=0
function button(id,dimension)
	local sign=id%2
	if sign == 0 then sign=-1 end
	if btn(id) then 
		speed=(1+speed)
		sum=(speed*sign)/count
		position[dimension]=position[dimension]+sum
		return id
	end
	return 'none'
end
room={x=0,y=0}
resolution={
	x=240,y=136
}
tilePixels=8
subpixelsPerPixel=16
function input()
	cls(13)
	map(room.x*resolution.x/tilePixels,
		room.y*resolution.y/tilePixels)
	print(room.x .. room.y,0,0)
	for i=0,3 do
		if btn(i) then  
			count=count+1
		end
	end
	button(0,'y')
	button(1,'y')
	button(2,'x')
	button(3,'x')
	
	if count==0 then	
		speed=0
	end
--	if count==2 then 
		--speed=(speed/math.sqrt(2))*(speed*2) 
--	end
	pixel={
		x=position.x/subpixelsPerPixel,
		y=position.y/subpixelsPerPixel
	}
	maxSpeed=32
	if speed>maxSpeed then 
		speed=maxSpeed 
	end
	if pixel.x>240 then 
		position.x=0 
		room.x=room.x+1
	end
	if pixel.x<0 then 
		room.x=room.x-1
		position.x=240*16 
	end
	if pixel.y<0 then 
		position.y=136*16 
		room.y=room.y-1
	end
	if pixel.y>136 then 
		position.y=0 
		room.y=room.y+1
	end
	if room.x<0 then room.x=7 end
	if room.y<0 then room.y=7 end
	
	if room.x>7 then room.x=0 end
	
	if room.y>7 then room.y=0 end
	rectb(0,0,resolution.x,resolution.y,5)
	spr(math.random(0,subpixelsPerPixel-1)*subpixelsPerPixel,
	pixel.x,pixel.y,-1,1,0,0,1,1)
	t=t+1
	count=0
end
function TIC()
	input()
	rect(16,100,resolution.x-16,50,4)
	syllable(100,100,'g','a')
	syllable(114,100,'b','i')
end

function syllable(x,y,c1,v1,v2,v3,c2)
	transparent=12
	consonant={
		hangul.consonants[c1],x,y,transparent
	}
	rightVowel={
		hangul.vowels[v1],x+6,y,transparent
	}
	downVowel={
		hangul.vowels[v2],x,y+5,transparent
	}
	finalConsonant={
		hangul.consonants[c2],x,y+11,transparent
	}
	diphthong={hangul.vowels[v3],	103,105,12}
	spr(table.unpack(consonant))
	--hangul.consonants.jj,100,100,12)	
	spr(table.unpack(rightVowel))	
	spr(table.unpack(downVowel))
	spr(
	table.unpack(finalConsonant)
	)
	spr(
	table.unpack(diphthong)
	)
end
